/* eslint-disable jsx-a11y/anchor-is-valid */
import React from 'react';
import './Header.css'
import logo from '../../assets/img/NPMLogo.png'
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import { Image, Button } from 'react-bootstrap';


export default function  Header() {
  return (
    <Navbar collapseOnSelect style={{magim:"2rem 0"}}>
    <Container fluid="xxl" >
      <Navbar.Brand 
      style = {{ 
        fontSize: "1.1rem",
        fontWeight: "500",
        lineHeight: "0.85rem",
        display: "flex",
        justifyContent:" center",
        alignItems:  "center"
      }} 
      href="#home">
     <Image  src={logo} style={{height: "1.5rem", marginRight: "0.5rem"}} />
     <Nav.Item  >LaslesNPM</Nav.Item>
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse className="justify-content-center" id="responsive-navbar-nav">
        <Nav style={{
            gap: "1.5rem",
          }}>
          <Nav.Link href="#About">About</Nav.Link>
          <Nav.Link href="#Features">Features</Nav.Link>
          <Nav.Link href="#Pricing">Pricing</Nav.Link>
          <Nav.Link href="#Testimonials">Testimonials</Nav.Link>
          <Nav.Link href="#Help">Help</Nav.Link>
        </Nav>
      </Navbar.Collapse>
        <Nav>
          <Nav.Link style={{color:"black"}}>Sing In</Nav.Link>
          <Button variant="danger"  className='buttonSingUp' size="sm">Sing Up</Button>
        </Nav>
    </Container>
  </Navbar>
  );
}
